import React from "react";
import Box from "@material-ui/core/Box";
import logoOurVisit from "../icons/logoOurVisit.png";
import "../components.css";
import { height } from "@material-ui/system";
import SettingsIcon from "@material-ui/icons/Settings";
import HelpOutlineIcon from "@material-ui/icons/HelpOutline";

export default function TestNav() {
  return (
    <div style={{ width: "100%" }}>
      <Box
        display="flex"
        flexDirection="row"
        p={1}
        m={1}
        bgcolor="background.paper"
        justifyContent="center"
        alignContent="center"
        width="1"
      >
        <Box p={1} width="1" bgcolor="grey.300" className="test">
          <img className="lambent-sizing" src={logoOurVisit} alt="Logo" />
        </Box>
        <Box p={1} width="50%" bgcolor="grey.300">
          <SettingsIcon color="action" style={{ fontSize: "inherit" }} />
        </Box>
        <Box p={1} bgcolor="grey.300">
          <HelpOutlineIcon color="action" style={{ fontSize: "inherit" }} />
        </Box>
      </Box>
    </div>
  );
}
